<aside class="notes"><p>I will be explaining some concepts that I use to manage my personal finances. Each person&#39;s needs are unique and there is not a one size fits all solution for every situation or risk tolerance.</p>

* Financial Independence is closely related to the concept of retiring early and pursuing to do what you want with your time.

* At its core, it is about maximizing your savings rate to achieve FI and have the freedom to retire as early as possible.

<aside class="notes"><ul>
<li>Discovering and achieving life goals: “What would I do with my life if I didn&#39;t have to work for money?&quot;</li>
<li>Simplifying and redesigning your lifestyle to reduce spending. Your wants and needs aren&#39;t written in stone, and less spending is powerful at any income level.</li>
<li>Working to increase your income and income streams with projects, side-gigs, and additional effort</li>
<li>Striving to save a large percentage (generally more than 50%) of your income to accelerate achieving FI</li>
<li>Investing to make your money work for you, and learning to manage/optimize those investments for the unique nature of FI/RE</li>
<li>Retiring Early</li>
</ul>
</aside></script></section><section  data-markdown><script type="text/template">
"Work is better when you dont need the money."

-- [Mr. Money Moustache](https://vimeo.com/183016901)

<aside class="notes"><p>Retirement does not necessarily mean &quot;quitting&quot;. Its just about having the freedom to do what you want.</p>
</aside></script></section><section  data-markdown><script type="text/template">
### The 10,000 Foot View

&nbsp;

"Spend less then you earn.

Invest the surplus.

Avoid debt."

-- JH Collins
</script></section><section  data-markdown><script type="text/template">

&nbsp;

Your savings rate,

as a percentage of your take-home pay

## The 4% rule

&nbsp;

You are ready to retire

once you can live on 4% of your savings per year.

<aside class="notes"><p>if your yearly cost is 40k, then you must have 1M saved
your savings will most likely continue to grow large after this</p>
</aside></script></section><section  data-markdown><script type="text/template">
## Phases of FI

&nbsp;

1. Getting out of debt

2. ** Building wealth **

3. Preserving wealth

&nbsp;

* Pay off highest interest loans first<!-- .element: class="fragment" -->
* etc.<!-- .element: class="fragment" -->

</script></section><section  data-markdown><script type="text/template">
## Reduce Phone Costs

&nbsp;

Average phone bill = $73

"Unlimited" plans are not worth it

Use an inexpensive no-contract MVNO instead

Pay $0 to $30 per month

&nbsp;

Yearly savings ($25 vs $60) = ~$400 / per line

&nbsp;

On average Americans spend $1,000 to $3,000 a year on eating out for lunch

&nbsp;

Yearly savings (BYOL) = ~$700

Invest those savings in an index fund, and 10 years later =<!-- .element: class="fragment" -->

~ $11,000<!-- .element: class="fragment" -->

* Bikes are inexpensive
* Requires no insurance, registration, license, parking spaces
* Easy to own (storage, upkeep, replacement)
* Saves time and money for not going to the gym
* Reduces medical expenses
* Bonus:
	* Biking is statistically safer than driving
	* [Increases your lifespan!](https://www.mrmoneymustache.com/2013/06/13/bicycling-the-safest-form-of-transportation/)

&nbsp;

Yearly savings by biking instead of driving = ~$8,000

## Emergency Fund

&nbsp;

Keep 0 to 9 months of your living expenses in liquid cash (bank account) depending on your tolerance.
</script></section><section  data-markdown><script type="text/template">
### Low fee, total stock market, index funds

&nbsp;

* An index mutual fund is said to provide broad market exposure and low portfolio turnover.<!-- .element: class="fragment" -->
* Total stock market means it tracks all publicly traded US companies, weighted by the market. When companies get too small, they get filtered out of the index.<!-- .element: class="fragment" -->
* Index funds usually have only %10 the management fee of managed mutual funds.<!-- .element: class="fragment" -->
</script></section><section  data-markdown><script type="text/template">
* "My advice to the trustee couldn't be more simple: Put 10% of the cash in short-term government bonds and __90%__ in a very __low-cost__ S&P 500 __index fund__. (I suggest Vanguard's.) I believe the trust's long-term results from this policy will be superior to those attained by most investors — whether pension funds, institutions or individuals — who employ high-fee managers."

-- [Warren Buffett](http://www.berkshirehathaway.com/letters/2013ltr.pdf)


<aside class="notes"><p>This guy is literally the best stock picker of all time.</p>
</aside></script></section><section  data-markdown><script type="text/template">
## Example Funds

* Vanguard: VTSAX, VTI

* Schwab: SWTSX, SCHB

* Fidelity: FSTMX

If you don't have access to total stock market:

* Find a broad market index

* Or something that tracks S&P 500 or Dow Jones, etc.

## Example Returns

Start with $10k in a saving account

* Bank savings rate = 0.5%

* Federal interest rate (40 year avg) = 5%

* Stock market growth = 8%


Put in an total stock market for 30 years:

<p class="fragment">[do nothing](http://money.cnn.com/calculator/pf/moneygrow/) = $100k</p>

<p class="fragment">[add $500/month](http://money.cnn.com/calculator/pf/moneygrow/) = $855k</p>

* Always expect them

## You Cannot Time the Market

&nbsp;

* No one can tell the future

* Don't believe anyone on TV who says they can

## The Market Always Goes Up

&nbsp;

Invest for the long term

* Over the last 40 years the [average yearly market](http://www.moneychimp.com/features/market_cagr.htm) increase is 12.6%

* Over the last 100 years the average yearly market increase is 12%

### Don't Get Cold Feet

* Those who leave money in the market longer tend to have better returns.

* [People who perform best with funds are:](http://www.businessinsider.com/forgetful-investors-performed-best-2014-9)

    * Those who forgot about their investments<!-- .element: class="fragment" -->
    * Those who are dead<!-- .element: class="fragment" -->


<aside class="notes"><p>to the young people in the room, time is on your side</p>
</aside></script></section><section  data-markdown><script type="text/template">
## Keep Disciplined

&nbsp;

* Don't wait to invest

* Put money in regularly

<aside class="notes"><p>even if there is a dip in the market your earlier gains can make up for it</p>
</aside></script></section><section  data-markdown><script type="text/template">
## Low Effort Self Management

&nbsp;

Takes a couple hours a year to check up on and rebalance if you want

<aside class="notes"><p>explain &quot;rebalancing&quot;</p>
</aside></script></section><section  data-markdown><script type="text/template">
## Diversification

&nbsp;

* Total stock market index has 3,000+ US companies.

* But if you want more diversification there are index funds for developing countries, developed non-US countries, specific sectors...

* Or bonds, gold, real estate, etc. (see risk vs. reward)
</script></section><section  data-markdown><script type="text/template">
## My Plan

&nbsp;

* Treat the index fund like my 401k and put in a fixed amount every month
* Keep 90% in total stock market (including retirement accounts)
* 10% in cash
* When I turn 50 I will start to re-balance 25% into bonds (wealth preservation)
</script></section><section  data-markdown><script type="text/template">
## Tax Optimization
</script></section><section  data-markdown><script type="text/template">
## Reducing Taxable Income

&nbsp;

* 401k - retirement = $18.5k / year
* IRA - retirement = $5.5 / year
* HSA - like a long term investable FSA = $3.4k / year
* 529 - college savings = $475k / lifetime in CA
* 457 - teacher savings plan = $35k / year
* Deductions, stock donations
</script></section><section  data-markdown><script type="text/template">
### Credit Card Rewards

&nbsp;

Churning is the practice of signing up for credit cards that offer large signup bonuses in the form of miles, points, or straight cash back for the purpose of obtaining the bonus before canceling the card.

<aside class="notes"><p>not for everyone, but with a little organization its relatively easy and people treat it like a game</p>
</aside></script></section><section  data-markdown><script type="text/template">
## Will this Affect my Credit Score?

<aside class="notes"><p>if you have good credit and are good at keeping it, this should not be bad for your FICO credit score</p>
</aside></script></section><section  data-markdown><script type="text/template">
## Example

&nbsp;

* Get a Chase credit card
* Spend $2k in the first 3 months
* Receive bonus of 50k travel points

Every 3 months open a different card and repeat
</script></section><section  data-markdown><script type="text/template">
## Example plan

* Chase Southwest Premier Business = 60k points
* Chase Southwest Plus = 50k
* Chase Sapphire Preferred = 50k
* Chase Sapphire Reserve = 50k
* Chase Ink Business Preferred = 80K
* United MileagePlus Explorer = 50k
* Chase Freedom = $150

2 years later you have ~300k points
worth ~$4k in flights/hotels/car rentals

<aside class="notes"><p>your mileage may vary, literally</p>
